/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `purchase` BEFORE INSERT ON `transaction` FOR EACH ROW BEGIN
        UPDATE wallet
        INNER JOIN transaction t on wallet.phone_number = t.phone_number
        INNER JOIN plan p on t.plan_ID = p.plan_ID
        SET balance = balance - p.price
        WHERE wallet.phone_number = NEW.phone_number;
    END */;;
